import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
import OTDZ from '../statics/FAST.png'


function ComprovanteVenda(data) {
    pdfMake.vfs = pdfFonts.pdfMake.vfs;
    
    const formapagamento = (id) => {
        switch (id) {
            case "DH":
                return "Dinheiro"
            case "CC":
                return "C. Crédito"
            case "CD":
                return "C. Débito"
            case "DP":
                return "PIX"
            }
    }

    function emailwhats(data) {
        if (data.telefone, data.email) {
            return `Sua nota fiscal será enviada através do E-mail: ${data.email} ou Whatsapp: ${data.telefone.replace(/^(\d{2})(\d{5})(\d{4})/, "($1) $2-$3")} que foram fornecidos no cadastro.`
        } else if (data.email != null) {
            return `Sua nota fiscal será enviada através do E-mail: ${data.email} que foi fornecido no cadastro.`
        } else if (data.telefone != null) {
            return `Sua nota fiscal será enviada através do WhatsApp: ${data.telefone.replace(/^(\d{2})(\d{5})(\d{4})/, "($1) $2-$3")} que foi fornecido no cadastro.`
        } else if (!data.email, !data.telefone) {
            return ""
        }
    }




    const titulo = [];

    const listdata = [
        {
            image: 'data:image/png;base64,',
            width: 75,
            height: 30
        },

        {
            text: '-------- Documento Auxiliar de Venda --------',
            fontSize: 4,
            bold: true,
            margin: [0,5,0,0],
            alignment: 'center'
            
        },


        {
            margin: [0,5,0,0],
            fontSize: 4,
            alignment: 'justify',
            bold: true,
            columns: [
                {
                    text: 'Ordem'
                },
                {
                    text: 'CPF'
                }
            ]

        },
        {
            fontSize: 4,
            alignment: 'justify',
            columns: [
                {
                    text: data.ordem
                },
                {
                    text: (data.cpf).replace(/(\d{3})(\d{3})(\d{3})(\d{2})/, "$1.$2.$3-$4")
                }
            ]

        },
        {
            margin: [0,2,0,0],
            fontSize: 4,
            alignment: 'justify',
            bold: true,
            columns: [
                {
                    text: 'Vendedor'
                },
                {
                    text: 'Total da Venda'
                }
            ]

        },
        {
            fontSize: 4,
            alignment: 'justify',
            columns: [
                {
                    text: data.vendedor
                    
                },
                {
                    text: parseInt(data.total_venda).toLocaleString('pt-br', {style: 'currency', currency: 'BRL'})
                }
            ]

        },
        {
            margin: [0,2,0,0],
            fontSize: 4,
            alignment: 'justify',
            bold: true,
            text: 'Nome: '
        },
        {
            fontSize: 4,
            alignment: 'justify',
            text: data.nome
        },
        {
            text: '--------------------------------------------------------',
            fontSize: 4,
            bold: true,
            margin: [0,5,0,0],
            alignment: 'center'
        },
        {
            text: 'Formas de Pagamento',
            fontSize: 4,
            bold: true,
            margin: [0,5,0,0],
            alignment: 'center'
        },
        {
            fontSize: 4,
            alignment: 'center',
            margin: [0,3,0,0],
            columns: [
                {
                    text: 'Forma'
                },
                {
                    text: 'Parcelas'
                },
                {
                    text: 'Valor'
                }
            ]

        },
        {
            text: '_________________________________________',
            fontSize: 4,
            alignment: 'center'
        },
        data.formavenda.map((formapag) => (
            {
                fontSize: 4,
                alignment: 'center',
                margin: [0,2,0,0],
                columns: [
                    {
                        text: formapagamento(formapag.forma)
                    },
                    {
                        text: formapag.parcelas
                    },
                    {
                        text: parseInt(formapag.valor).toLocaleString('pt-br', {style: 'currency', currency: 'BRL'})
                    }
                ]
            }
        )),
        {
            text: '--------------------------------------------------------',
            fontSize: 4,
            bold: true,
            margin: [0,5,0,0],
            alignment: 'center'
        },
        {
            text: 'Produtos',
            fontSize: 4,
            bold: true,
            margin: [0,5,0,0],
            alignment: 'center'
        },
        {
            fontSize: 4,
            alignment: 'center',
            margin: [0,3,0,0],
            columns: [
                {
                    text: 'Codigo'
                },
                {
                    text: 'Descrição'
                },
                {
                    text: 'Valor'
                }
            ]

        },
        {
            text: '_________________________________________',
            fontSize: 4,
            alignment: 'center'
        },
        data.corpovenda.map((corpo) => (
            {
                fontSize: 3.7,
                alignment: 'center',
                margin: [0,2,0,0],
                columns: [
                    {
                        text: corpo.codpro
                    },
                    {
                        text: corpo.descripro
                    },
                    {
                        text: parseInt(corpo.valor_unitpro).toLocaleString('pt-br', {style: 'currency', currency: 'BRL'})
                    }
                ]
            }
        )),
        {
            text: '--------------------------------------------------------',
            fontSize: 4,
            bold: true,
            margin: [0,5,0,0],
            alignment: 'center'
        },
        {
            text: 'ATENÇÃO',
            fontSize: 5,
            margin: [0,5,0,0],
            alignment: 'center'
        },
        {
            text: `Esse documento não é um documento fiscal.${emailwhats(data)}`,
            fontSize: 4,
            margin: [0,5,0,0],
            alignment: 'center'
        },
        {
            text: 'Qualquer dúvida, entre em contato com nosso DiniZAP pelo telefone (27) 3185-8101.',
            fontSize: 4,
            alignment: 'center',
            margin: [0,2,0,0],
        },
        {
            text: 'Siga nossas redes sociais e fique por dentro de todas novidades.',
            fontSize: 4,
            alignment: 'center'
        },
        {
            margin: [0,5,0,0],
            qr: 'https://www.instagram.com/oticasdinizvitoria/',
            fit: '50',
            alignment: 'center'
        },

    ];

    const rodape = [];

    const docDefinitions = {
        pageSize: {
            width: 80,
            height: 297,
        },
        pageMargins: [1, 0, 1, 0],
        

        header: [titulo],
        content: [listdata],
        footer: [rodape],
    }

    pdfMake.createPdf(docDefinitions).open({}, window)
}

export default ComprovanteVenda